import React, { useEffect, useState } from 'react';
import axios from 'axios';
import config from '../config';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  LineElement,
  PointElement,
  CategoryScale,
  LinearScale,
  Title,
  Tooltip,
  Legend
} from 'chart.js';

ChartJS.register(LineElement, PointElement, CategoryScale, LinearScale, Title, Tooltip, Legend);

const Predictions = () => {
  const [data, setData] = useState(null);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(true);
  const [retryCount, setRetryCount] = useState(0);

  const fetchCSVDataAndAnalyze = async () => {
    try {
      setLoading(true);
      const res = await axios.get(`${config.url}/palpitation_analysis_csv`);
      setData(res.data);
      setError('');
    } catch (err) {
      console.error('Error analyzing CSV data:', err);
      setError('Failed to analyze CSV heart rate data.');
      if (retryCount < 3) {
        setTimeout(() => setRetryCount(retryCount + 1), 2000);
      }
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchCSVDataAndAnalyze();
  }, [retryCount]);

  if (loading) return <p className="text-blue-500 text-center">Loading data... Please wait.</p>;
  if (error) return <p className="text-red-500 text-center">{error}</p>;
  if (!data) return null;

  const {
    latest_prediction,
    all_predictions,
    trend_graph,
    heart_rate_trend,
    timestamp_trend,
    accuracy,
    classification_report,
    confusion_matrix
  } = data;

  return (
    <div className="p-4 max-w-3xl mx-auto">
      <h1 className="text-2xl font-bold mb-4 text-center text-gray-800">Heart Rate Prediction (CSV)</h1>

      <div className="text-center mb-6">
        <p className="text-lg mb-2">Latest Prediction: <strong>{latest_prediction}</strong></p>
        <p className="text-md">Model Accuracy: <strong>{(accuracy * 100).toFixed(2)}%</strong></p>
      </div>

      {heart_rate_trend && timestamp_trend && (
        <div className="flex justify-center mb-8">
          <div className="w-[340px] text-center shadow-md p-4 rounded-2xl bg-white">
            <h2 className="text-lg font-semibold mb-2 text-gray-700">Heart Rate Trend</h2>
            <Line
              data={{
                labels: timestamp_trend,
                datasets: [{
                  label: 'Heart Rate',
                  data: heart_rate_trend,
                  borderColor: 'rgba(75,192,192,1)',
                  backgroundColor: 'rgba(75,192,192,0.2)',
                  fill: true,
                  tension: 0.3,
                }]
              }}
              options={{
                responsive: false,
                maintainAspectRatio: false,
              }}
              width={300}
              height={200}
            />
          </div>
        </div>
      )}

      <div className="mb-10">
        <h2 className="text-lg font-semibold mb-4 text-gray-700 text-center">Confusion Matrix</h2>
        <div className="grid grid-cols-3 gap-4 max-w-xs mx-auto">
          {confusion_matrix.map((row, rowIndex) =>
            row.map((val, colIndex) => (
              <div
                key={`${rowIndex}-${colIndex}`}
                className="bg-blue-100 text-blue-800 text-center py-4 rounded-md font-semibold shadow"
              >
                {val}
              </div>
            ))
          )}
        </div>
      </div>

      <div className="mb-8">
        <h2 className="text-lg font-semibold mb-4 text-gray-700 text-center">Classification Report</h2>
        <div className="overflow-x-auto">
          <table className="min-w-full border border-gray-300 shadow-md rounded-md overflow-hidden text-sm text-left">
            <thead className="bg-gray-100 text-gray-700">
              <tr>
                <th className="px-4 py-2 border">Label</th>
                <th className="px-4 py-2 border">Precision</th>
                <th className="px-4 py-2 border">Recall</th>
                <th className="px-4 py-2 border">F1-score</th>
              </tr>
            </thead>
            <tbody>
              {Object.entries(classification_report)
                .filter(([label]) => !['accuracy', 'macro avg', 'weighted avg'].includes(label))
                .map(([label, scores]) => (
                  <tr key={label} className="hover:bg-gray-50">
                    <td className="border px-4 py-2">{label}</td>
                    <td className="border px-4 py-2">{(scores.precision * 100).toFixed(2)}%</td>
                    <td className="border px-4 py-2">{(scores.recall * 100).toFixed(2)}%</td>
                    <td className="border px-4 py-2">{(scores['f1-score'] * 100).toFixed(2)}%</td>
                  </tr>
                ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Predictions;
